import React, { useState, useEffect } from "react";
import { get } from "../Helpers";

export default function SearchResults(props) {
  const [results, setResults] = useState(undefined);

  useEffect(() => {
    let stocks = new Map();
    get(
      "https://finnhub.io/api/v1/stock/symbol?exchange=US&token=bpleiinrh5r8m26im1dg"
    ).then((res) => {
      for (let stock of res) {
        let symbol = stock["displaySymbol"];
        let firstChar = symbol[0];
        if (stocks.has(firstChar)) {
          stocks.get(firstChar).push(symbol);
        } else {
          stocks.set(firstChar, []);
        }
      }

      let r = new Map();

      let matched = stocks.get(props.searchText[0]);

      for (let symbol of matched) {
        if (symbol.includes(props.searchText)) {
          arr.push(
            <div>
              <a
                onClick={() => {
                  props.setSelectedStock(symbol);
                }}
                style={{ fontSize: 25 }}
              >
                {symbol}
              </a>
            </div>
          );
        }
      }
    });
  }, []);

  function matching() {
    let arr = [];
    let matched = stocks.get(props.searchText[0]);
    console.log(
      get(
        "https://finnhub.io/api/v1/stock/profile2?symbol=AAPL&token=bpleiinrh5r8m26im1dg"
      )
    );
    for (let symbol of matched) {
      if (symbol.includes(props.searchText)) {
        arr.push(
          <div>
            <a
              onClick={() => {
                props.setSelectedStock(symbol);
              }}
              style={{ fontSize: 25 }}
            >
              {symbol}
            </a>
          </div>
        );
      }
    }
    return arr;
  }

  return <div>{matching()}</div>;
}
